import React, {Component} from 'react';
import {connect} from 'react-redux';


import { withStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';
import Grid from '@material-ui/core/Grid';
import TextField from '@material-ui/core/TextField';

const styles = theme => ({
  card: {
    minWidth: 275,
    marginBottom: 20,
  },
  bullet: {
    display: 'inline-block',
    margin: '0 2px',
    transform: 'scale(0.8)',
  },
  title: {
    fontSize: 14,
  },
  pos: {
    marginBottom: 12,
  },
    textField: {
    marginLeft: theme.spacing.unit,
    marginRight: theme.spacing.unit,
    width: 200,
  },
});



class ExpertProfile extends Component{
  constructor(props){
    const {currentUserName} = this.props
    const {currentUserMail} = this.props
    super(props)
      this.state = {
        name: currentUserName,
        mail:currentUserMail,
        apellidos:"",
        documento:""
      }

  }

    handleChange = name => event => {
      this.setState({
      [ name]: event.target.value,
      });
    };

  render(){
  const { classes } = this.props;
   console.log(this.state.name)


  return (
    <div>
    <h2> Mi perfil</h2> 

    <Grid container >
      <Grid container sm={6} >
        <TextField
          label="Nombre"
          className={classes.textField}
          value={this.state.name}
          onChange={this.handleChange('name')}
        />

        <TextField
          label="Apellidos"
          className={classes.textField}
          value={this.state.apellidos}
          onChange={this.handleChange('apellidos')}
        />
        <TextField
          label="Doc de Identidad"
          className={classes.textField}
          value={this.state.documento}
          onChange={this.handleChange('documento')}
        />
      </Grid>
      </Grid>

    </div> 
    )
}
}


function mapStateToProps(state){
  return{

    currentUserName: state.currentUser.user.name,
    currentUserMail: state.currentUser.user.name
  };
};

export default connect(mapStateToProps,) (withStyles(styles)(ExpertProfile))
